#!/bin/bash
# https://bolknote.ru (bash script)
# https://eugenelazarev.medium.com (icons)

function writeFlag()
{
    local mark="$1"
    local file="$2"

    /usr/bin/awk "/^#$mark/{print \$2}" "$0" | /usr/bin/base64 -d | /usr/bin/bunzip2 > $file
}

MOUNT='/Volumes/Ilya Birman Typography Layout'
TMPDIR=$(/usr/bin/mktemp -d)
TMP="$TMPDIR/installer.app"
trap "/bin/rm -rf $TMPDIR" EXIT

echo Mounting dmg file
/usr/bin/hdiutil attach -quiet ~/Downloads/ilya-birman-typolayout-*-mac.dmg -mountpoint "$MOUNT"
echo Copying the installer
/bin/cp -r "$MOUNT/"*.app "$TMP"
/usr/bin/xattr -cr "$TMP"

APP=$(echo "$TMP/Contents/Resources/Layout/"*.bundle'/Contents/Resources')

echo Patching English language flag
writeFlag EN "$APP/English - Ilya Birman Typography.icns"
echo Patching Russian language flag
writeFlag RU "$APP/Russian - Ilya Birman Typography.icns"

echo Running patched installer

/usr/bin/open -W "$TMP"

echo Removing patched installer

exit

